import React from "react";
import { Card, Col } from "react-bootstrap";

function StudentCard(props) {
  const { name, age, grade, image } = props;

  return (
    <Col md={4}>
      <Card>
        <Card.Img variant="top" src={image} />
        <Card.Body>
          <Card.Title>{name}</Card.Title>
          <Card.Text>
            Age: {age} <br />
            Grade: {grade}
          </Card.Text>
        </Card.Body>
      </Card>
    </Col>
  );
}

export default StudentCard;
